import { Redirect } from 'react-router';
import { Header } from "../../common/Header";
import {
    MDBBtn,
    MDBFreeBird,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBCardText,
    MDBCol,
    MDBContainer,
    MDBFormInline,
    MDBIcon,
    MDBInput,
    MDBRow,
    MDBTable,
    MDBTableBody,
    MDBTableHead,
    MDBEdgeHeader,
    MDBCardTitle,
    MDBProgress,
    MDBListGroup,
    MDBListGroupItem
} from "mdbreact";
import { useHistory } from "react-router";
import "./style.css"
import Charts from "react-apexcharts";
import { Chart } from "../common/VulnChart"
import { CategoryChart } from "../common/VulnCatChart"
export const Home = (props: any) => {
    const token = localStorage.getItem("token");
    if (token === null || token === undefined || token.length < 0) {
        return <Redirect to={{
            pathname: '/login',
        }} />
    }
    return (
        <>
            <MDBContainer fluid className="pt-5 pb-5" style={{ padding: "2vw" }}>
                <MDBRow style={{ minHeight: "80vh" }}>
                    <MDBCol sm="6" md="6" lg="6">

                    </MDBCol>
                    <MDBCol sm="6" md="6" lg="6">
                    <h6 style={{fontWeight: 800}}>Penetration test</h6>
                    <p style={{ fontSize: "11px" }}>This pentest is an authorized simulated cyberattack on a computer system, performed to evaluate the security of the system.</p>
                        <MDBRow>
                            <Chart />
                            <CategoryChart />
                        </MDBRow>

                    </MDBCol>




                </MDBRow>
            </MDBContainer>
        </>
    )
}
